import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";  // Assuming Navbar is in this location
import SearchBar from "./components/SearchBar";  // Assuming SearchBar is in this location
import Login from "./components/Login"; // Assuming Login component
import HomePage from "./pages/HomePage"; // Assuming HomePage component

function App() {
  const [searchQuery, setSearchQuery] = useState("");

  return (
    <Router>
      <Navbar />
      {/* <SearchBar setSearchQuery={setSearchQuery} /> */}
      <Routes>
        <Route path="/" element={<HomePage searchQuery={searchQuery} />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
